import web from './6.jpg';
import app from './7.jpg'
import android from './8.jpg'
import digital from './9.jpg'
import software from './10.jpg'
import marketing from './11.jpg'

const Sdate = [
    {
        img:web,
        title:"Web Development"
    },
    {
        img:app,
        title:"App Development"
    },
    {
        img:android,
        title:"Android Development"
    },
    {
        img:digital,
        title:"Digital Marketing"
    },
    {
        img:software,
        title:"Software Development"
    },
    {
        img:marketing,
        title:"Marketing"
    }
];

export default Sdate;
